    "Establishment of a Nesting Gadwall Population at Iroquois National Wildlife Refuge
    Progress Report Four",nt"tracking_summary": {ntt"total": 1,ntt"recent":
    1nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2016-07-27T23:00:08.447136",nt"name": "establishment-of-a-nesting-gadwall-population-at-iroquois-national-wildlife-refuge-progres-e71de",nt"isopen":
    false,nt"url": null,nt"notes": "The main goal of the project is to establish
    a nesting population of Gadwalls on the Iroquois National Wildlife Refuge by capturing
    ducklings by night-lighting on Montezuma National Wildlife Refuge and releasing
    them on Iroquois. There was no evidence that the release of 12 ducklings in 1969
    resulted in any nesting in 1970. Nine additional ducklings were released in 1970.
    Four birds (2 each season) of the 1969 release were shot prior to the 1971 nesting
    season. This left a total of 17 ducks (8 males and 9 females) that could have survived
    to May 1971. During the nesting season of 1971, three pairs were noted on territory
    at Iroquois. We have no data on nesting for one pair, the second pair apparently
    attempted to nest, and the third pair hatched 12 ducklings - the first recorded
    breeding record for the entire Niagara Frontier Region. Excellent success was obtained
    in capturing and transferring ducklings from Montezuma to Iroquois during the 1971
    season. Forty birds were released on August 1 and 22 on August 18 for a total of
    62 for the season.",nt"license_title": "License Not Specified",nt"extras":
